マググリップは、フラッシュに取り付けるベースです。超強力なネオジム磁石が内蔵され、全てのモジュールを瞬時に交換、あらゆる光を一瞬にしてコントロールする事を可能にします。<br><br>
従来の機種別アクセサリーや、ベルクロやテープによる交換の煩雑さから開放され、撮影だけに集中いただけます。<br><br>
メーカーや機種を問わない、ユニバーサルフィット。ほとんどの全てのフラッシュ、スピードライトにご利用いただけます。<br><br>
【製品の詳細】<br><br>
■ 商品内容：マググリップ x 1<br>
■ メーカーや機種を問わない、ユニバーサルフィット。ほとんどの全てのフラッシュ、スピードライトにご利用いただけます。<br>
■ 超強力なネオジム磁石により、全てのモジュールを瞬時に確実に取付・交換できます。<br>
■ 高品質なシリコンラバーを使用し、一体成形で作られています。<br><h2>MAGMOD Magnetic Modular Modifiers</h2>
<font size="2" color="#464646">
磁力を利用した新しいフラッシュシステム<br>
</font>
<br><br>
<img width="825" src="http://image.rakuten.co.jp/richter/cabinet/images/imgrc0068317854.jpg"><br><br>
