マググジェル・クリエイティブセットは、マグモッド専用カラーフィルターのセットです。<br><br>
シートはポリカーボネート製で、長期間使用いただけます。<br><br>
フラッシュへの取り付けには、マグジェルスロット、及びベースのマググリップが必要です。<br><br>
【製品の詳細】<br><br>
